import { React , useState , useEffect } from "react";
import Card from "./Card";
import { Link } from "react-router-dom";
import axios from 'axios'

const Home = () => {
  
  const [posts,changePosts] = useState([])

  useEffect(()=>{

    axios.get("http://127.0.0.1:8000/posts/").then(res=>changePosts(res.data)).catch(err=>alert(err))

  },[])

  return (
    <div>
      

          <p className="text-4xl text-gray-900 dark:text-dark px-64 mt-8 mb-5 ">
            Fresh Recommendations
          </p>

          <div className=" flex flex-wrap px-64 justify-evenly">
            <Link to="post/1"><Card data/></Link>
            <Link to="post/2"><Card /></Link>
            <Link to="post/3"><Card /></Link>
            <Link to="post/4"><Card /></Link>
            <Link to="post/5"><Card /></Link>


            { posts && 
              posts.map(data => {
                return <Link to={`post/${data.id}`} > </Link>
              })
            }


            
          </div>

          
        
        
    </div>
  );
};

export default Home;
